import React, { Component } from 'react';
class Header extends Component {




    render() {
        const logo = require('./logo.jpeg'); // with require


        return (

            <div>
                <div class="container">

                    <div className="row">
                        <div class="col-sm header">
                        {/* <img src="src/images/jb banner.png"> */}
                        <img src={logo}></img>

                        </div>


                    </div>
                </div>
            </div>
        )
    }
}
export default Header;
